import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  ok() {
    alert('click');
  };


  render() {
    const title = 'This is the application\'s Charmella';
    const test = [
      'test 1',
      'test 2',
      'test 3',
    ]
    return (
      <div className="App">
        <p>{title}</p>
        <div> {
          test.map(element => {
            return <div onClick={this.ok}>{element}</div>
        })
        } </div>
      </div>
    );
  }
}

export default App;
